import React, { Component } from 'react';
import Progressbar from './Progressbar';

class Languages extends Component {

    niveau = {
        Tbl_Languages: [
            {id: 1, value: "htmlcss", exp:1.8},
            {id: 2, value: "Js", exp:2},
            {id: 3, value: "Php", exp:0.7},
            {id: 4, value: "Sql", exp:1.4},
            {id: 5, value: "Java", exp:0.4}
        ]
    }


    render() {
        return (
            <div className='languages'>
            <div className="languages-content">
                <div className="languages-content-htmlcss">
                    HTML / CSS
                </div>
                <div className="languages-content-Javascript">
                    JS
                </div>
                <div className="languages-content-php">
                    PHP
                </div>
                <div className="languages-content-sql">
                    SQL
                </div>
                <div className="languages-content-java">
                    JAVA
                </div>
            </div>
            <div className="languages-bar">
                <Progressbar />



            </div>            
        </div>
        );
    }
}



export default Languages;
